import styled from "styled-components";

export const StyledMain = styled.main`
  margin: 0 auto;
  width: 80%;
  display: flex;
  ul {
    display: flex;
    flex-wrap: wrap;
    ul > li:nth-child(n + 5) {
      margin-left: 30px;
    }
  }
`;
